import React from 'react';

const PeopleCard = ({name, gender, height, mass}) =>{

	return(

		<div className= 'f.5 tc'>

		<p> Name: {name}</p>
		<p> Gender: {gender}</p>
		<p> Height:{height} CM</p>
		<p> Mass: {mass} KG </p>

		</div>

		);
}


export default PeopleCard
